import React from 'react';

const HeroCard = ({ 
  id, 
  superhero, 
  publisher, 
  alter_ego, 
  first_appearance, 
  characters}) => {
    return (
      <div 
        className='card ms-3' 
        style={{maxWidth:333}}
      >
        <div className='row no-gutters'>
          <div className='col-md-4'>
            <img 
              src={`../assests/heroes/${id}.jpg`}
              className='card-img'
              alt={superhero}/>
          </div>
          <div className='col-md-8'>
            <h5 className='card-title'>
              {superhero}</h5>
          </div>
        </div>

        {id} 
        {superhero} 
        {publisher} 
        {alter_ego} 
        {first_appearance} 
        {characters} 
      </div>
    )}

export default HeroCard;
